 -- \u0432\u0441\u0435 \u0431\u044b\u043b\u043e \u043d\u0435 \u0441\u043e\u0432\u0441\u0435\u043c \u0442\u0430\u043a \u0413\u0430\u0440\u0438\u043a \u043e\u0431\u0438\u0434\u0438\u0442\u0441\u044f, \u0447\u0442\u043e \u0435\u0433\u043e\u003cbr\u003e\u0432\u044b\u0432\u0435\u043b\u0438 \u043d\u0435\u043f\u0440\u043e\u0442\u0438\u0432\u043b\u0435\u043d\u0446\u0435\u043c \u0438 \u043f\u0440\u0438\u043f\u043e\u043c\u043d\u0438\u0442 \u0442\u0435\u0431\u0435 \u043a\u0430\u0436\u0434\u044b\u0439 \u0441\u043b\u0443\u0447\u0430\u0439 \u043a\u043e\u0433\u0434\u0430 \u0435\u043c\u0443 \u0443\u0434\u0430\u043b\u043e\u0441\u044c\u003cbr\u003e\u0441\u0442\u0443\u043a\u043d\u0443\u0442\u044c \u043a\u0443\u043b\u0430\u043a\u043e\u043c \u043f\u043e \u0441\u0442\u043e\u043b\u0443 \u0411\u0430\u0435\u0432 \u043e\u043f\u044f\u0442\u044c \u0432\u043e\u0437\u043e\u043c\u043d\u0438\u0442 \u043e \u0441\u0435\u0431\u0435 \u0431\u043e\u0433 \u0432\u0435\u0441\u0442\u044c \u0447\u0442\u043e\u003cbr\u003e\u0432\u043f\u0440\u043e\u0447\u0435\u043c, \u0447\u0442\u043e \u0431\u044b \u0442\u044b \u043d\u0438 \u043d\u0430\u043f\u0438\u0441\u0430\u043b\u0430, \u043e\u043d \u043e\u0431\u044f\u0437\u0430\u0442\u0435\u043b\u044c\u043d\u043e \u0432\u043e\u0437\u043e\u043c\u043d\u0438\u0442 \u041f\u0435\u0442\u044f\u003cbr\u003e\u0443\u0441\u043e\u043c\u043d\u0438\u0442\u0441\u044f, \u0430 \u0413\u0430\u0440\u0438\u043a \u043f\u0440\u0438\u043f\u043e\u043c\u043d\u0438\u0442 \u043f\u043e\u044d\u0442\u043e\u043c\u0443 \u0437\u0430\u0442\u043a\u043d\u0438 \u0443\u0448\u0438 \u0438 \u043f\u0438\u0448\u0438 \u0435\u0441\u043b\u0438 \u0436\u0438\u0437\u043d\u044c \u043d\u0435\u003cbr\u003e\u0440\u0430\u0441\u0441\u0442\u0430\u0432\u0438\u043b\u0430 \u0432\u0441\u0435 \u0442\u043e\u0447\u043a\u0438 \u043d\u0430\u0434 \u0438 \u0441\u0434\u0435\u043b\u0430\u0439 \u044d\u0442\u043e \u0437\u0430 \u043d\u0435\u0435!) \u043d\u0435\u0442, \u041c\u0438\u0442\u044f, \u0442\u044b \u043d\u0435\u003cbr\u003e\u043f\u043e\u043d\u0438\u043c\u0430\u0435\u0448\u044c \u0447\u0442\u043e\u0431\u044b \u0440\u0430\u0441\u0441\u043a\u0430\u0437\u0430\u0442\u044c \u043e \u043d\u0430\u0441 (us but not them) \u043f\u0440\u0438\u0434\u0435\u0442\u0441\u044f \u0432\u044b\u0431\u0440\u043e\u0441\u0438\u0442\u044c\u003cbr\u003e\u0442\u043e, \u0447\u0442\u043e \u043a \u0442\u0435\u043c\u0435 \u043d\u0435 \u043e\u0442\u043d\u043e\u0441\u0438\u0442\u0441\u044f \u0432 \u043e\u0441\u043e\u0431\u0435\u043d\u043d\u043e\u0441\u0442\u0438 \u043a\u0440\u0443\u043f\u043d\u043e\u0435, \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u043d\u043e\u0435 \u0438\u003cbr\u003e\u0441\u043e\u0446\u0438\u0430\u043b\u044c\u043d\u043e \u0437\u043d\u0430\u0447\u0438\u043c\u043e\u0435 \u0437\u0430\u0431\u0438\u0442\u044c \u043d\u0430 \u043f\u043e\u0442\u0435\u0440\u044f\u043d\u043d\u043e\u0435 \u043f\u043e\u043a\u043e\u043b\u0435\u043d\u0438\u0435 \u0437\u0430 \u043d\u043e\u0432\u043e\u0441\u0442\u044f\u043c\u0438 \u043d\u0435\u003cbr\u003e\u0441\u043b\u0435\u0434\u0438\u0442\u044c, \u0432 \u0432\u044b\u0431\u043e\u0440\u0430\u0445 \u043d\u0435 \u0443\u0447\u0430\u0441\u0442\u0432\u043e\u0432\u0430\u0442\u044c \u043e\u0441\u0442\u0430\u0432\u0438\u0442\u044c \u0432 \u043f\u043e\u043a\u043e\u0435 \"\"\u043b\u0438\u0445\u0438\u0435\u003cbr\u003e\u0434\u0435\u0432\u044f\u043d\u043e\u0441\u0442\u044b\u0435\"\" \u0441\u043e\u0431\u0438\u0440\u0430\u0442\u044c \u043c\u0435\u043b\u043a\u043e\u0435, \u043d\u0435\u0437\u043d\u0430\u0447\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0435 \u0445\u0443\u0436\u0435 \u0442\u043e\u0433\u043e, \u0441\u0443\u0433\u0443\u0431\u043e \u043b\u0438\u0447\u043d\u043e\u0435,\u003cbr\u003e\u0432\u044a\u0435\u0432\u0448\u0435\u0435\u0441\u044f \u043a\u0430\u043a \u0440\u0436\u0430\u0432\u0447\u0438\u043d\u0430 \u043d\u0435\u0432\u044b\u0432\u043e\u0434\u0438\u043c\u043e\u0435 \u043a\u0430\u043a \u0441\u043e\u043b\u043d\u0435\u0447\u043d\u044b\u0439 \u043e\u0436\u043e\u0433 \u0434\u0443\u043c\u0430\u0435\u0448\u044c, \u043d\u0430\u0441\u003cbr\u003e\u043f\u043e\u0439\u043c\u0443\u0442 (\u0445\u0432\u0430\u0442\u0438\u0442 \u0438\u0437\u043b\u0438\u0432\u0430\u0442\u044c\u0441\u044f, \u0433\u043e\u0432\u043e\u0440\u0438\u0442 \u0411\u0430\u0435\u0432 \u043f\u043e\u0434\u0433\u0440\u0435\u0431\u0430\u0439 \u0431\u043b\u0438\u0436\u0435 \u043a \u0434\u0435\u043b\u0443 -- \u0447\u0442\u043e\u003cbr\u003e\u0442\u0430\u043c \u0443 \u0442\u0435\u0431\u044f \u043d\u0435\u0432\u044b\u0432\u043e\u0434\u0438\u043c\u043e\u0435 \u043a\u0430\u043a \u043f\u044f\u0442\u043d\u043e \u043e\u0442 \u043f\u043e\u0440\u0442\u0432\u0435\u0439\u043d\u0430 \u043d\u0430 \u0431\u0435\u043b\u043e\u043c \u043b\u0430\u0431\u043e\u0440\u0430\u0442\u043e\u0440\u043d\u043e\u043c\u003cbr\u003e\u0445\u0430\u043b\u0430\u0442\u0438\u043a\u0435) \u043b\u0430\u0434\u043d\u043e, \u0434\u0430\u0432\u0430\u0439\u0442\u0435 \u043f\u043e\u0438\u043c\u0435\u043d\u043d\u043e: \u0438\u0437 \u043d\u0435\u0437\u043d\u0430\u0447\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u043f\u0440\u0435\u0434\u043b\u0430\u0433\u0430\u044e\u003cbr\u003e\u043e\u0441\u0442\u0430\u0432\u0438\u0442\u044c \u0411\u043e\u043b\u044c\u0448\u0443\u044e \u0445\u0438\u043c\u0438\u0447\u0435\u0441\u043a\u0443\u044e \u0430\u0443\u0434\u0438\u0442\u043e\u0440\u0438\u044e \u0434\u0432\u0443\u0448\u043a\u0438, \u043f\u044f\u0442\u043d\u0430\u0448\u043a\u0438 \u0438 \u0436\u0435\u0442\u043e\u043d\u0447\u0438\u043a\u0438 \u043d\u0430\u003cbr\u003e\u043c\u0435\u0442\u0440\u043e \u043f\u0438\u0432\u043e \"\"\u0425\u0430\u043c\u043e\u0432\u043d\u0438\u043a\u0438\"\", \"\"\u041c\u0435\u0434\u0432\u0435\u0436\u044c\u044e \u043a\u0440\u043e\u0432\u044c\"\" \u043f\u0440\u0438\u0432\u0430\u0442\u0438\u0437\u0430\u0446\u003cb\u003e\u0438\u043e\u043d\u003c/b\u003e\u043d\u044b\u0439\u003cbr\u003e\u0447\u0435\u043a \u043d\u0430 360 \u041a\u0431 \u043f\u0438\u0441\u044c\u043c\u0430, \u0437\u0430\u043f\u0438\u0441\u043a\u0438 \u0438 \u0432\u044b\u043f\u0438
